import React, { useEffect, useState } from 'react'
import { GetStudentCourses } from '../../services/api'
import { useLocation } from 'react-router-dom'
import './profile.scss'

const Profile = () => {
    const { state } = useLocation();
    const [results, setResults] = useState([]);
    useEffect(() => {
        if (state._ID) {
            GetStudentCourses(state._ID)
                .then(response => response.json())
                .then(data => {
                    if (data.data) {
                        setResults(data.data)
                    } else {
                        alert(`${data.message}`)
                    }
                }
                )
        } else {
            alert("Please login again.")
        }
    }, [])
    console.log("results: ", results);
    return (
        <div className='profile-container'>
            <div className="header-container">
                <h1 className="username">Student name: <span className='username-container'></span></h1>
                <h2 className="student-id">ID: <span className='id-container'></span></h2>
            </div>
            <div className="courses-registered">
                <h1 className="courses-registered__title">Student's courses</h1>
                {/* {results.map(course => <h3 className='course-name' >{}</h3>)} */}
            </div>
        </div>
    )
}

export default Profile
